', '', '', '', '', '', '', '', '', '1691', '1', 'Monitor adanya kelelahan otot bantu nafas, Monitor status respirasi dan oksigenisasi, Pertahankan kepatenan jalan nafas, Berikan posisi semi fowler atau fowler, Bantu untuk merubah posisi jika diperlukan, Analisis efek perubahan posisi pada pernafasan (mis. AGD, SpO2), Lakukan auskultasi bunyi pernafasan secara teratur, Monitor suhu tubuh, Identifikasi keadaan emosional ibu saat akan menyusui, Dilakukan konseling menyusui, Identifikasi keinginan dan tujuan menyusui, Identifikasi permasalahan yang ibu alami selama proses menyusui, Gunakan tehnik mendengarkan dan mempelajari (misal, duduk sama tinggi, dengarkan permasalahan ibu), Berikan informasi dan saran menyusui yang benar sesuai kebutuhan ibu, Berikan pujian terhadap perilaku ibu yang benar.<div>Kolaborasi : Pasang CPAP peep 7 FiO2 21% flow 8 Lpm, rencana SHK IC (+), lapor hasil DR</div>', NULL, '1691', 0, NULL, '2025-02-15 17:52:45')
